import React, { useEffect, useState } from 'react';
import Navbar from '../components/Navbar'; // Ensure this path is correct based on your project structure
import { getUserGrievances } from '../services/api';
import './Profile.css';

const Profile = () => {
  const [grievances, setGrievances] = useState([]);
  
  useEffect(() => {
    const fetchGrievances = async () => {
      try {
        const response = await getUserGrievances();
        setGrievances(response.data);
      } catch (error) {
        console.error('Error fetching grievances:', error);
      }
    };
    
    fetchGrievances();
  }, []);

  return (
    <div>
      <Navbar /> {/* Add Navbar here */}
      <div className="profile-container">
        <h2>Profile</h2>
        <p>Email: {/* Add email display here if needed */}</p>
        <h3>Your Grievances:</h3>
        <ul>
          {grievances.map((grievance, index) => (
            <li key={index}>
              <strong>{grievance.title}</strong><br />
              "{grievance.description}"<br />
              Status: {grievance.status}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Profile;
